import React from "react";
import styled from "styled-components";
import { Swiper, SwiperSlide } from "swiper/react";

const Container = styled.div`
  width: 25vw;
  height: 70vh;
`;

const Carousel = () => {
  return <Container>Carousel</Container>;
};

export default Carousel;
